import React from 'react'

function PostFeedSmart() {
    return (
        <div>
            <form>
                <input type="text">Goal_ID</input>
                <input type="text">User_ID</input>
                <input type="text">Message_text</input>
                <input type="image" alt="test">Post_image</input>
            </form>
        </div>
    )
}
export default PostFeedSmart;
